  description: "# Spinnaker as an Operator\n\nThis Operator allows users to spin up\
    \ Open Enterprise Spinnaker (OES) to manage deployments etc., using Openshift\
    \ CRD&#39;s. With the help of Spinnaker Services Operator, users will have the\
    \ convenience and confidence of simplified approach to execute CI/CD process with\
    \ high velocity and quality deployments in all environments. \n\n## What is Spinnaker?\n\
    \n* Spinnaker is an Open Source, multi-cloud Continuous delivery platform to perform\
    \ software releases with high velocity and confidence.\n* Spinnaker helps user\
    \ to create deployment pipelines that run integration and system tests, spin up\
    \ and down server groups, and monitor your rollouts.\n* OES has enterprise value-adds\
    \ as described at http://opsmx.com\n\n### List of Features\n\n* Multi-Cloud Deployment\
    \ - Deploy your VM or Containers or functions across most public and private cloud\
    \ including AWS EC2, ECS, EKS, Lambda, Kubernetes, Google Compute Engine, Google\
    \ Kubernetes Engine, Google App Engine, Microsoft Azure, OpenStack, with Oracle\
    \ Bare Metal and DC/OS.\n* Automated Releases with Pipelines - Create deployment\
    \ pipelines that run integration and system tests, spin up and down server groups,\
    \ and monitor your rollouts. Trigger pipelines via git events, Jenkins, Travis\
    \ CI, Docker, CRON, or other Spinnaker pipelines\n* Pipeline-as-code - Manage\
    \ the pipeline as code (JSON) or interact with pipeline using API or UI.\n* Safe\
    \ Deployment Strategies - Deploy using Canary or Red/Black (Blue/Green) or Rolling\
    \ update and enable automated Canary analysis to ensure safety of the new updates\
    \ before full-rollout to production\n* 1-click Rollback - Rolling back new deployments\
    \ is never been easier with a 1-click rollback of images/configurations.\n* See\
    \ more spinnaker.io or docs.opsmx.com\n"
